import React from 'react';
import './Keypad.scss';

const Keypad = () => {
  const keys = [4, 5, 6, 7, 8, 9, 'c', "\u2155", "\u0025", 3, 2, 1, 0 ,'\u2190', ','];
  // []
  return (
    <div className="keypad">
      { keys.map((key, index) => <button key={index}>{ key }</button>) }
    </div>
  )
}

export default Keypad;
